            // variant = "outlined"
            name = "username"
            type = "text" 
            placeholder = "username"
            onChange = {changeHandler}
            />
          </div>
            <div>
            <TextField 
            // variant = "outlined"
            name = "password"
            type = "text"
            placeholder = "password"
            onchange = {changeHandler}
            />
          </div>
            <div>
            <TextField
            // variant = "outlined"
            name = "email"
            vaule = "email"
            type = "text"
            placeholder = "email"
            onchange = {changeHandler}
            />
            </div>

            <Button> Buyer </Button> or  <Button> Seller </Button>
        </form>
</>
    )
}
export default Register
